import logo from './logo.svg';
import './App.css';
import Amplify from "aws-amplify";
import AppConfig from "./config";
import PageTemplate from "./common/layout/PageTemplate";
import { Route, Switch, Router, Link } from "react-router-dom";
import { createBrowserHistory } from "history";
const history = createBrowserHistory();

Amplify.configure({
  API: {
    endpoints: [
      {
        name: AppConfig.AMPLIFIER_API_NAME,
        endpoint: "http://localhost:3000"
      }
    ]
  }
});

function Home() {
  console.log('Home');
  return <h2>Home</h2>;
}

export const ChildTransactionDetailsPage = () => {
  console.log('ChildTransactionDetailsPage');
  return ( 
  <div>     

  <p>test</p>

  </div>
  );
};

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

function App() {
  return (
    /*<Router history={history}>
    <Switch>
          <Route path="/" component={PageTemplate} />
          <Route key="/child-details" path="/child-details"><Home/></Route>
    </Switch>
    </Router>*/
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
